import React from "react";
import { Table } from "antd";
const DishTable = ({ data }) => {
  return (
    <Table
      components={this.components}
      columns={this.state.columns}
      dataSource={data}
      bordered
      rowClassName="editable-row"
      title={() => "Dish Menu"}
      footer={() => "Footer"}
      pagination={false}
      scroll={{ y: 500 }}
    />
  );
};

export default DishTable;
